import React, { Component } from 'react';
import './styleSheet.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Home from './components/home';
import Support from './components/support';
import Error from './components/error';
import Navigation from './components/navigation';
import Payments from './components/payments';
import Transfers from './components/transfers';
import Utilities from './components/utilities';
import Electricity from './components/buyElectricity';
import Accounts from './components/accounts';
import Newacc from './components/newacc';
import AccInfo from './components/accInfo';
import BankingReg from './components/bankingReg';
import Legal from './components/legal';
import Faq from './components/faq';
import Contact from './components/contact';
import Login from './components/login';
import MyAccounts from'./components/myAccounts';
import myCards from './components/myCards';
import statements from './components/statements';
import downloadStatements from './components/downloadStatements';
import beneficiary from './components/beneficiary';
import existing from './components/existing';
import history from './components/history';
import scheduled from './components/scheduled';






class App extends Component {
  constructor(props) {
    super(props);
    this.state = { username: "" }
  }

  setunpw(username, password) {
    this.thisState({username: username})
  }
  render() {
    return (

      <BrowserRouter>
      <div>


      <Login setUNPW={this.setunpw}/>
      <Switch>
        <Route path="/" component={Home} exact/>
        <Route path="/support" component={Support}/>
        <Route path="/payments" component={Payments}/>
        <Route path="/transfers" component={Transfers}/>
        <Route path="/utilities" component={Utilities}/>
        <Route path ="/buyElectricity" component={Electricity}/>
        <Route path="/accounts" component={Accounts}/>
        <Route path="/newacc" component={Newacc}/>
        <Route path="/accInfo" component={AccInfo}/>
        <Route path="/bankingReg" component={BankingReg}/>
        <Route path="/legal" component={Legal}/>
        <Route path="/faq" component={Faq}/>
        <Route path="/contact" component={Contact}/>
        <Route path="/MyAccounts" component={MyAccounts}/>
        <Route path="/myCards" component={myCards}/>
        <Route path="/statements/:accid" component={statements}/>
        <Route path="/downloadStatements" component={downloadStatements}/>
        <Route path="/beneficiary" component={beneficiary}/>
        <Route path="/existing" component={Existing}/>
        <Route path="/history" component={History}/>
        <Route path="/scheduled" component={Scheduled}/>

        <Route component={Error}/>
      </Switch>


      </div>
      </BrowserRouter>

    );
  }
}

export default App;
